window.bookSummaryJSON = "<p><b>Jensen, Finn, Christian, and Rhys. </b></p> <p>One is my protector, another my best friend, the third my betrothed, and the fourth...something else entirely. </p> <p><i>And I want them all.</i></p> <p>I never thought I'd fall for more than one man, but then again, I didn't think I would wake up on my birthday the queen of the Shadow Court, hunted, in danger, and unable to control my newfound fae powers. Which seem to get stronger the more I give in to my need for these men.</p> <p>In order to claim my title, I have to complete a set of trials with my men at my side. But a dark force is out to kill me, and every day that passes they get closer to their goal. </p> <p>I spent my life thinking I was human. I couldn't have been more wrong. <br> Now the fate of the Shadow Court fae rests on my shoulders.</p> <p><b>I am Queen of the Shadow Court, they are my men, and nothing will stop me from taking my throne.</b></p> <p><b>This book contains M/F, M/M, and M/F/M/M/M scenes. Originally published in serialized form as </b><b><i>The Queen of the Shadow Court</i></b><b>, this title has been re-edited, and more content has been added.</b></p>"; 
